import { makeStyles } from "@mui/styles";


export const useStyles = makeStyles({
  divPhone:{
    marginRight:'48px',
    "&:last-child": {
      marginRight: 0,
      marginLeft:"48px",
    },
    width:'50%',
    display:"flex",
    flexDirection:'column',
  },
  text:{
    '& p':{
      fontSize:'20px',
      height:'80px',
      width:'300px',
      textAlign:"center",
      color:'grey',
      marginTop:'21px',
      marginRight:0
    }
  }

})
